import {useEffect, useState} from "react";
import {API_URL} from "../../consts";
import {useNavigate} from "react-router-dom";
import { treeItemClasses } from "@mui/lab";
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import Button from '@mui/material/Button';

const DisplayTrials = () => {
    const [trial, setTrial] = useState([]);

    const getTrial = () => {
        fetch(`${API_URL}/displaytrials`, {
            method: 'GET',
        }).then(res => res.json())
            .then(trial => {
                setTrial(trial)
            }).then(console.log(typeof(trial))
            );
    }

    // const getTrial = () => {
    //     fetch(`${API_URL}/displaytrials`)
    //         .then(response => response.json());
    // }

    useEffect(getTrial, []);
    return(
        <>
        <div>

            <input
                //value={trial[0].BriefTitle}
                // onChange={(e) => setTrial({...trial, BriefTitle: e.target.value})}
                className="form-control"/>

        </div>

        <List sx={{ width: '100%' }}>
        {trial.map((t) => {
                return <>
                    <div className = "cf-trials-box">
                  <ListItem alignItems="flex-start">
                    <ListItemText
                      primary={t.BriefTitle}
                      secondary={
                        <React.Fragment>
                          <Typography
                            sx={{ display: 'inline' }}
                            component="span"
                            variant="body2"
                            color="text.primary"
                          >
                          </Typography>
                          {t.BriefSummary}
                        </React.Fragment>
                      }
                    />
                    <Button>View Details</Button>
                  </ListItem>
                    </div>
                  <Divider component="li" />
                </>

            })}

            </List>
            </>

    );
};
export default DisplayTrials;
